INSERT INTO `blog` VALUES (7,'2024-08-05 15:43:20.608000','<p style=\"color: rgb(105, 105, 105); font-family: Arial, Tahoma, Helvetica, FreeSans, sans-serif;\">Happy Summer! Sorry I have been MIA, I have been busy trying to finish the homeschool year with the boys and working part-time at my husband\'s business. Luke is a senior in high school and just has to finish calculus and Isaac is still working on chemistry, but they are both almost done! We also went to the beach two weekends ago which was absolutely wonderful. The beach is my happy place.&nbsp;</p><p style=\"color: rgb(105, 105, 105); font-family: Arial, Tahoma, Helvetica, FreeSans, sans-serif;\"><b>I hope your summer is going great!</b><br></p><p style=\"color: rgb(105, 105, 105); font-family: Arial, Tahoma, Helvetica, FreeSans, sans-serif;\">Today I wanted to post a new square mood storyboard set. This set has clipping masks, so just add your images using the clipping masks (with the free action included in the download). To grab colors from your images, double-click on each \"mood\" square to open up the color picker and then click on a color in your image to grab it. This is a great way to get an inspired color palette. You can print or post these photo storyboards.</p><p style=\"color: rgb(105, 105, 105); font-family: Arial, Tahoma, Helvetica, FreeSans, sans-serif;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"CoffeeShop Modern Botanicals ad.jpg\" style=\"width: 640px;\"></p><p style=\"color: rgb(105, 105, 105); font-family: Arial, Tahoma, Helvetica, FreeSans, sans-serif;\">Today I wanted to share a new printable digital paper pack I call \"Modern Botanicals\". I love creating illustration-themed papers and I used many of the beautiful images from The Graphics Fairy premium site to create this set. Most of the images were color but I wrote a little action that quickly turns them into B&amp;W illustrations. I will be sharing that action with you this week.&nbsp;</p><p style=\"color: rgb(105, 105, 105); font-family: Arial, Tahoma, Helvetica, FreeSans, sans-serif;\">This set of papers are 8.5 x 11 inches so they can all be printed or used on the web and they come with free commercial terms-of-use. You can see a blown-up version below of the details.&nbsp;</p>','CoffeeShop \"Square Mood Boards #5\" Photo Template Set!',1,'CoffeeShop Square Mood 5 ad.jpg'),(8,'2024-08-05 15:48:53.091000','<h2 style=\"font-family: &quot;DM Sans&quot;, sans-serif; letter-spacing: calc(var(--font-heading-letter-spacing) * 0.1); color: rgb(4, 4, 4); line-height: var(--font-heading-line-height); overflow-wrap: break-word; max-width: 100%; font-size: calc(var(--font-heading-h2-scale) * 4rem); margin-top: 4rem;\"><b>Paper Cups</b></h2><h6 style=\"line-height: 1.5; color: rgb(4, 4, 4); font-family: &quot;DM Sans&quot;, sans-serif;\"><p style=\"line-height: 1.5;\">Paper cups are a popular option for to-go coffee orders, as they are lightweight, inexpensive, and disposable. They also come in a variety of sizes, from 8oz to 20oz, making them a versatile option for different types of coffee drinks. Paper cups with a ripple, spiral, or double wall feature are designed to keep hot drinks hot and hands cool. Below are the types of paper coffee cups to go.</p></h6><h3 style=\"font-family: &quot;DM Sans&quot;, sans-serif; letter-spacing: calc(var(--font-heading-letter-spacing) * 0.1); color: rgb(4, 4, 4); line-height: var(--font-heading-line-height); overflow-wrap: break-word; max-width: 100%; font-size: calc(var(--font-heading-h3-scale) * 2.4rem); margin-top: 4rem;\"><b>Double Wall Coffee Cups</b></h3><h3 style=\"font-family: &quot;DM Sans&quot;, sans-serif; letter-spacing: calc(var(--font-heading-letter-spacing) * 0.1); color: rgb(4, 4, 4); line-height: var(--font-heading-line-height); overflow-wrap: break-word; max-width: 100%; font-size: calc(var(--font-heading-h3-scale) * 2.4rem); margin-top: 4rem;\"><img src=\"https://restaurantware-ae.myshopify.com/cdn/shop/files/Blog-the-best-coffee-cups-for-to-go-orders-2.png\" alt=\"Double wall coffee cup\"><img src=\"data:image/png;base64,\" data-filename=\"image.png\" style=\"width: 300px;\"><b><br></b></h3><h3 style=\"font-family: &quot;DM Sans&quot;, sans-serif; letter-spacing: calc(var(--font-heading-letter-spacing) * 0.1); color: rgb(4, 4, 4); line-height: var(--font-heading-line-height); overflow-wrap: break-word; max-width: 100%; font-size: calc(var(--font-heading-h3-scale) * 2.4rem); margin-top: 4rem;\">Coffee enthusiasts who care about the environment can now have their caffeine fix on the go with double wall paper coffee cups! These innovative, eco-friendly containers are made of two walls that keep drinks hot longer and provide a comfortable drinking experience due to reduced heat transfer from liquid to hands. Plus, the special barrier coating prevents any unwanted leakage or spills - perfect for busy commuters always looking for an extra layer of protection against accidents.</h3><h3 style=\"font-family: &quot;DM Sans&quot;, sans-serif; letter-spacing: calc(var(--font-heading-letter-spacing) * 0.1); color: rgb(4, 4, 4); line-height: var(--font-heading-line-height); overflow-wrap: break-word; max-width: 100%; font-size: calc(var(--font-heading-h3-scale) * 2.4rem); margin-top: 4rem;\"><b>Ripple Coffee Cups</b></h3><h3 style=\"font-family: &quot;DM Sans&quot;, sans-serif; letter-spacing: calc(var(--font-heading-letter-spacing) * 0.1); color: rgb(4, 4, 4); line-height: var(--font-heading-line-height); overflow-wrap: break-word; max-width: 100%; font-size: calc(var(--font-heading-h3-scale) * 2.4rem); margin-top: 4rem;\"><img src=\"https://restaurantware-ae.myshopify.com/cdn/shop/files/Blog-the-best-coffee-cups-for-to-go-orders-3.png\" alt=\"Ripple wall coffee cup\"><img src=\"data:image/png;base64,\" data-filename=\"image.png\" style=\"width: 300px;\"><b><br></b></h3><h3 style=\"font-family: &quot;DM Sans&quot;, sans-serif; letter-spacing: calc(var(--font-heading-letter-spacing) * 0.1); color: rgb(4, 4, 4); line-height: var(--font-heading-line-height); overflow-wrap: break-word; max-width: 100%; font-size: calc(var(--font-heading-h3-scale) * 2.4rem); margin-top: 4rem;\">Made from specially designed paper, these unique vessels come in intricate patterns that provide an eye-catching appeal. Not only are they aesthetically pleasing, but they are also environmentally friendly due to their recyclability - no extra materials or waste necessary. Plus, since these cups feature built-in insulation properties, you can enjoy your favorite hot drinks for long periods of time without the worry of them going cold quickly. Plus, ripple wall paper cups have got you covered: made using strong material that won\'t rip or break when handled properly.<b><br></b></h3>','Drip Coffee',1,'Blog-types-of-coffee-brewing-methods-1.jpg');
