INSERT INTO `product` VALUES (1,_binary '','<p>Khng cn n Ty Bc mi cm nhn c s trong tro ca ni rng, khi Tr Xanh Latte t Nh c cht lc t nhng bp tr xanh mt,  mnh trong sng sm.</p><p><img src=\"https://scontent.fhan15-1.fna.fbcdn.net/v/t1.6435-9/52908232_2294043650869648_8679597214034558976_n.jpg?stp=dst-jpg_s720x720&amp;_nc_cat=109&amp;ccb=1-7&amp;_nc_sid=13d280&amp;_nc_ohc=LbFKxCHsyZ8Q7kNvgGCWFxs&amp;_nc_ht=scontent.fhan15-1.fna&amp;oh=00_AYC8u27JxwHRxAnbQ4rPTN7c_zg0vMMjVNzxCEFThluTTw&amp;oe=66DB50E8\" alt=\"Khng c m t nh.\"><br></p><p> </p>',0,'greenLatte.png','Tr Xanh Latte',45000,94,0,3),(2,_binary '',' Xay Frosty Tr Xanh nh li mi mc mc, gh thm Ty Bc vo nhng ngy tit tri se lnh, ni o my ph. V cht du, ngt thanh ca tr xanh Ty Bc kt hp  xay snh mn, whipping cream bng bnh v bt tr xanh trn cng thm m v.',0,'frostyTraXanh.png','Frosty Tr Xanh',59000,95,0,3),(3,_binary '','Thc ung gip tnh to tc th  bt u ngy mi tht hng khi. Khng ng kht nh c ph truyn thng, The Coffee House Sa  mang hng v hi ho y li cun. L s m  ca 100% c ph Arabica Cu t rang va ti.',0,'thecoffeehouse.png','The Coffee House Sa ',39000,97,0,1),(4,_binary '','Nu chung v c ph m , bng n v thch v ng en ngt thm, ng en Sa  ch th l thc ung dnh cho bn. Khng ch gip bn tnh to bui sng, \r\n\r\n',0,'duongdensuada.png','ng en Sa ',45000,99,0,1),(5,_binary '','ng en Marble Latte m du cc hp dn bi v c ph ng nh ho quyn cng v ng en ngt thm v sa ti bo mn. S kt hp y mi m ca c ph v ng en cng to nn din mo phn tng p mt.\r\n\r\n',0,'ddMarble.png','ng en Marble Latte',55000,99,0,1),(6,_binary '','B sp k Lk do quo ha quyn cng C ph Arabica Cu t m mt. Khuy u  thng thc hng v ti tnh, y mi l!',0,'boarabica.png','B Arabica',49000,100,0,1),(7,_binary '','Khng ngt ngo nh Bc su hay C ph sa, C ph en mang trong mnh phong v trm lng, thi v hn. Ngi ta thng phi ngi rt lu mi cm nhn c ht hng thm ngo ngt, phng pht mi cacao v ci ng mt m tri tut xung vm hng.',0,'caphedennong.png','C Ph en Nng',39000,86,0,2),(8,_binary '','Tr Xanh Latte (Nng) l phin bn r v tr nht. Nhp mt ngm, bn chm ngay v tr xanh Ty Bc cht nh ho cng sa nguyn kem thm bo, ng li hu v ngt ngo, m du. ',0,'traxanhlattenong.png','Tr Xanh Latte (Nng)',45000,94,0,3),(9,_binary '','r Xanh ng en vi hiu ng phn tng p mt, nh phc ho ni i Ty Bc bng lng trong sng my, thp thong nhng nng ch xanh ngt.',0,'traxanhduongden.png','Tr Xanh ng en',55000,98,0,3),(10,_binary '','Khng th ri mi vi Mochi Kem Matcha do mn, nng nnh. Tr Xanh Ty Bc v mc ho quyn sa ti, foam ph mai beo bo v vn bnh quy gin tan, l la chn m khng kh l hi.',0,'cloudTea.png','CloudTea Tr Xanh Ty Bc',69000,99,0,3),(11,_binary '','B sp k Lk do quo ha quyn cng Tr Sa Oolong T Qu m hng. Kh cng vi hng v ngt ngo, m b, snh mn. Khuy u  thng trn v bn nh!',0,'trasuolongtuquy.png','Tr Sa Oolong T Qu B',59000,83,0,2),(12,_binary '','Tr en c  mi mi ngy, gi nguyn c v cht mnh m c trng ca l tr, ph bn trn l lp Macchiato \"homemade\" bng bnh quyn r v ph mai mn mn m bo bo.',0,'tradenmachiato.png','Tr en Macchiato',55000,100,0,3),(13,_binary '','Bc su chnh l \"Ly sa trng km mt cht c ph\". Thc ung ny rt ph hp nhng ai va mun tri nghim cht v ng ca c ph va mun thng thc v ngt bo ngy t sa.',0,'bacsiunong.png','Bc Su Nng',39000,100,1,1),(14,_binary '','Mt tch Espresso nguyn bn c bt u bi nhng ht Arabica cht lng, phi trn vi t l cn i ht Robusta, cho ra v ngt caramel, v chua du v snh c.',0,'Espresso.png','Espresso Nng',45000,100,1,1),(15,_binary '','Tn hng hng v Oolong nng m  c Nh rang k cng, quyn cng sa thm bo, cng thm hp dn vi sng so thanh mt.',0,'oolong.png','Tr Sa Oolong Nng Sng So',40000,79,0,2),(16,_binary '','Croissant trng mui thm lng, bn ngoi v bnh gin hp dn bn trong trng mui v ngon kh cng.',0,'croissant.png','Croissant Trng Mui',39000,97,0,4),(17,_binary '','Bnh Butter Croissant bn  yu, nay yu khng li thot khi c chm cng sa c. Thm b mn sa, ngt ngo lng nhau!',0,'butter.png','Butter Croissant Sa c',35000,99,0,4),(18,_binary '','Hng v chn i ng gu m  vi tr oolong c sao (nng) lu hn cho hng v m , ha quyn vi sa thm bo mang n cm gic mt lnh, lu luyn v tr sa m  ni vm hng.',0,'trasuanuong.png','Tr sa Oolong Nng Trn Chu',55000,89,0,2),(19,_binary '','Bao bc bi lp v Mochi do thm, bn trong l lp kem lnh cng nhn phc bn t ngt ngo. Gi 1 chic Mochi cho ngy tht ti mt. Sn phm phi bo qun mt v dng ngon nht trong 2h sau khi nhn hng.',0,'mochikem.png','Mochi Kem Phc Bn T',19000,99,0,4),(20,_binary '','Hng v d ghin c to nn bi cht ng nh ca c ph, lp kem trng bo ngt du hp dn',0,'tiramisu.png','Mousse Tiramisu',35000,99,0,4),(21,_binary '','Vi v ngoi ng yu v hng v ngt ngo, thm bo nht nh bn phi th t nht 1 ln.',0,'gauchocolate.png','Mousse Gu Chocolate',39000,99,0,3),(22,_binary '','Bc su chnh l \"Ly sa trng km mt cht c ph\". Thc ung ny rt ph hp nhng ai va mun tri nghim cht v ng ca c ph va mun thng thc v ngt bo ngy t sa.',0,'bacxiunong.png','Bc Su Nng',39000,98,0,3),(23,_binary '\0','Thanh mt v cn bng vi hng v c ph nguyn bn 100% Arabica Cu t cng sa ti thm bo cho tng ngm trn v, hp dn.\r\n\r\n',0,'coldbrew.png','Cold Brew Sa Ti',49000,100,1,1),(48,_binary '','Ca Phe Sua',0,'test','Ca Phe Sua',10000,10,1,1),(49,_binary '','<p>test</p>',0,'ti xung.jpeg','test',10,10,0,1);
